import React from 'react';

const inputPara = (props) => {
  return(
    <div>
      <p onClick={props.click}>This is the first paragraph! - Username: {props.username}</p>
      <p>This is the second paragraph! - NewName: {props.newName}</p>

      <input
        type='text' onChange={props.change} value={props.newName}>
      </input>

    </div>
  );
};

export default inputPara;
